#include <iostream>#include <vector>long long gcd(long long a, long long b){    long long max = std::max(a, b), min = std::min(a, b);    if(0 == max % min){        return min;    }else{        return gcd(min, max % min);    }}int main(){    long long a, b;    std::cin >> a >> b;    long long max = std::max(a, b), min = std::min(a, b);    std::vector<long long> vec{1};    for(long long i = 2; i * i <= max; ++i){        if(min == min % i){            break;        }else{            if(0 == a % i && 0 == b % i){                vec.push_back(i);            }        }    }    return 0;}